INSERT INTO `t_course_teaching_class_homework_baseinfo` (`id`, `t_course_teaching_class_id`, `t_teacher_id`, `t_course_teaching_class_homework_type_id`, `flag`, `file_requirement`, `title`, `content`, `pubdate`, `enddate`) VALUES
	('19CBE00427574279B7D17785D71E0CB8', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '9E0C6AADCDF1482B871B89BB78721BF8', '1', '[{"nodeID":0,"parentNodeID":"-1","fileType":"0","fileTypeDescription":"zip文件","fileTypeData":"*.zip","fileFormat":"0","filenameRequirementVal":"{作业类型}_{作业名称}_{自然班}_{学号}_{姓名}","fileCount":"1"}]', '课程综合项目', '<p>课程综合项目</p><p>请大家在附件里面选择一个题目，或者经过老师许可自拟题目，完成一个综合项目。</p><p>要求：</p><p>1.项目具有一定的实用性和复杂性。</p><p>2.利用Android多项技术。</p><p>3.如果能够提供需求、设计、编码规范、测试等相关软件工程文档则会加分。</p><p>4.如果能够上传到应用市场，则会加分。<br></p>', '2016-09-03 23:48:14', '2016-11-15 13:55:00'),
	('1E045C64089E4B30977A59FF6A38481E', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', 'B4BB25408D6849618BB0CE917A69DE5C', '1', '[]', '计算器', '<p><br></p>', '2016-12-18 14:27:08', '2017-01-02 14:27:00'),
	('264CBB5DC9E5488EAE690E375D2FC45D', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]SharedPreferences', '<p>1.掌握SharedPreferences的使用方法</p><p>2.编写程序，向SharedPreferences写入学号、姓名等信息并读取、显示这些信息。</p><p>3.初步了解Android Device Monitor的使用方法，并学会查看文件、进程等信息。</p><p>4.初步掌握adb的使用。</p><p>5.将代码上传到github上。</p><p>6.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p><div><br></div>', '2016-09-01 05:58:26', '2016-10-01 13:55:00'),
	('27B784DA0B704AD9A768628AB9FB517B', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]内部存储文件操作', '<p>1.掌握向内部存储卡上写入文件和读取文件的方法。</p><p>2.编程实现向内部存储卡写入学号、姓名等信息并读取、显示这些信息。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-01 06:05:46', '2016-10-01 13:55:00'),
	('2827AF06C6DB4E5FBAFDB64B5872E565', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]Activity间单向传递数据', '<p>掌握在两个Activity之间如何传递数据，其中数据有String、int等多种格式。<br>要求：<br>1.掌握使用Intent携带数据。<br>2.掌握获得Intent携带的数据。<br>3.将代码上传到github上。<br>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。<br></p>', '2016-08-30 02:25:10', '2016-10-01 15:55:00'),
	('28804F26EB6F4610BE70F81F979C3998', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]SQLite数据库使用', '<p>1.了解SQLite嵌入式数据库特点。</p><p>2.掌握Android中对SQLite数据库进行操作的相关类和方法。</p><p>3.实现单词本，实现对单词的增、删、改、查等。</p><p>4.将代码上传到github上。</p><p>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-01 07:24:57', '2016-10-01 13:55:00'),
	('44731FD1D5B542079EB527D0DC3BE27E', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]Activity生命周期', '<p>熟悉Activity生命周期，使用Logcat观察各回调函数调用次序。<br>要求：<br>1.了解Activity生命周期<br>2.了解回掉函数调用次序<br>3.了解各回调函数基本用途。<br>4.将代码上传到github上。<br>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p><p><br></p>', '2016-08-30 01:46:17', '2016-10-01 15:55:00'),
	('4541D1B4C35D4C22BDC5DF85676EA27F', 'E3BDEF0490D94F8C883A7495607BC8F8', '438FAA7ED7DA41069CC933B99A1C314D', 'B3DAA102CB5C4DB09273761AF45B7132', '1', '[{"nodeID":0,"parentNodeID":"-1","fileType":"0","fileTypeDescription":"word文件","fileTypeData":"*.doc;*.docx","fileFormat":"0","filenameRequirementVal":"{作业类型}_{作业名称}_{自然班}_{学号}_{姓名}","fileCount":"1"}]', '顺序程序和选择程序', '<p>实验目的：</p><p>1.熟悉C语言特性，熟悉VC编程环境</p><p>2.掌握C语言数据类型，能够熟悉定义整型、浮点型、字符型等类型变量</p><p>3.理解选择结构的作用</p><p>4.掌握关系表达式和逻辑表达式，并能够正确运用与计算。</p><p>5.掌握if、else、switch等语句。</p><p>实验内容：</p><p>1.学习辅导手册p259 (4)题</p><p>2.实验指导书 (第2章2.2节)第2题</p><p>3.实验指导书 (第2章2.2节)第3题</p><p>4.学习辅导手册p260 (1)题</p><p>5.实验指导书 (第4章4.2节)第5题</p>', '2016-10-11 08:05:22', '2016-10-30 15:55:00'),
	('4732245A93474A07899537B72E0216A2', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]学会使用常用组件', '<div>使用TextView、EditText、Button、CheckBox、RadioButton等编写一个界面，该界面有上述元素，要求按下Button时修改EditText内容，按下CheckBox、RadioButton等修改TextView内容为用户所选择的选项。</div><div>1.学会常用组件在Layout文件中的使用方法。</div><div>2.学会监听器的使用</div><div>3.学会onClick等属性的使用</div><div>4.将代码上传到github上。</div><div>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</div>', '2016-08-29 05:06:23', '2016-10-01 15:55:00'),
	('49F38D475F1E4ABFAAD727707BF4DFB7', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]使用Intent隐式启动', '<p>掌握使用Intent隐式启动的方法。<br>1.&lt;intent-filter&gt;元素作用与含义<br>2.&lt;intent-filter&gt;写法，尤其是action,category等元素写法<br>3.掌握隐式启动使用方法。<br>4.将代码上传到github上。<br>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。<br></p>', '2016-08-31 02:18:01', '2016-10-01 15:55:00'),
	('53C0B7A80CD848FAA41C3CA79651E404', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]对话框', '<p>界面有两个按钮，点击时分别弹出提示对话框和登录对话框，其中登录对话框要求用户输入UserId和Password，如果UserId和Password不是“abc”、“123”，则使用Toast提示错误，否则提示成功。</p><p>1.理解对话框的构成和基本的使用方法。</p><p>2.注意自定义对话框的用法。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-08-29 05:09:18', '2016-10-01 15:55:00'),
	('597C348893014A3E9AEF8FC237DD357F', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]横屏和竖屏', '<p>了解Android下为适用不同屏幕所采取的技术，编程实现横屏时显示一个界面，竖屏时显示不同界面。<br>1.理解不同语言、不同分辨率、横屏竖屏等限定符的使用<br>2.编程实现横屏、竖屏显示不同界面，有时间的话为不同语言或分辨率也进行设置。<br>3.将代码上传到github上。<br>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。<br></p>', '2016-08-30 08:24:06', '2016-10-01 15:55:00'),
	('5B724601762446E1A9F9AF0599EA177D', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]掌握Fragment，练习左右分栏', '<p>理解Fragment，掌握Fragment的使用并编程实现简单单词本。<br>要求：<br>1.理解Fragment，理解其复用性。<br>2.掌握Fragment编程使用。<br>3.理解Fragment和Activity交互。<br>4.将代码上传到github上。<br>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。<br></p>', '2016-08-30 08:23:43', '2016-10-01 15:55:00'),
	('5E6C3CDA07264D4280FD9AC19DEAE9CC', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]菜单', '<p>使用XML定义菜单项，并制作选项菜单、上下文菜单和弹出菜单。</p><p>1.理解Android菜单含义与用途。</p><p>2.学会定义菜单项和处理菜单项选择事件。</p><p>3.理解不同类型菜单的应用场合与编程方法。</p><p>4.将代码上传到github上。</p><p>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-08-29 05:09:02', '2016-10-01 15:55:00'),
	('6360071BF9F9421E9BF316CCF2439838', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]Activity间来回传递数据', '<p>掌握多个Activity之间来回传递数据，既能够将数据传递给指定的Activity，也能够获得Activity返回的数据。<br>1.掌握使用Intent传递数据。<br>2.掌握获得Intent携带的数据。<br>3.区分不同Activity返回的数据。<br>3.将代码上传到github上。<br>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。<br></p>', '2016-08-30 02:28:10', '2016-10-01 15:55:00'),
	('6721E5FB9E6B425E89EB75D3E04260DB', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '访问“联系人”信息', '<p>1.了解系统ContentProvider基本概念。</p><p>2.掌握访问联系人ContentProvider方法，并编程实现。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-04 02:54:04', '2016-10-01 13:55:00'),
	('69BA8F7B61A14C2E8E57286DE20CC4E7', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', 'AB9F64C2B65E4E029FCD90B9F1687B32', '1', '[{"nodeID":0,"parentNodeID":-1,"fileType":"0","fileTypeDescription":"word文件","fileTypeData":"*.doc;*.docx","fileFormat":"0","filenameRequirementVal":"{作业类型}_{作业名称}_{自然班}_{学号}_{姓名}","fileCount":"1"}]', '实现计算器', '<p>编写一个简单的计算器。</p><p>主要功能：</p><p>支持整数和小数运算（内部采用浮点，允许一定误差）。</p><p>支持加减乘除等运算。</p><p>支持连续加、减等复杂运算。</p><p>支持sin,cos,幂等多种函数计算。</p><p>支持单位换算。</p>', '2016-08-29 04:46:01', '2016-10-31 13:55:00'),
	('730806FAA6844BB8990B37AEC9C7DD18', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]使用Intent拨打电话', '<p>掌握隐式启动，掌握使用Intent拨打电话。<br>1.隐式启动作用<br>2.权限的基本使用方法<br>3.拨打电话基本方法<br>4.将代码上传到github上。<br>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。<br></p>', '2016-08-31 02:18:23', '2016-10-01 15:55:00'),
	('76C62F119F4647C8BC468D4E25231E22', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]ContentProvider', '<p>1.掌握ContentProvider、ContentResolver、Uri等概念</p><p>2.将前面单词本改写成ContentProvider，并编写程序访问它。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-04 02:53:42', '2016-10-01 13:55:00'),
	('77B4F992D2CC420DBCECDEE6C502655D', 'E3BDEF0490D94F8C883A7495607BC8F8', '438FAA7ED7DA41069CC933B99A1C314D', 'B3DAA102CB5C4DB09273761AF45B7132', '1', '[{"nodeID":0,"parentNodeID":"-1","fileType":"0","fileTypeDescription":"word文件","fileTypeData":"*.doc;*.docx","fileFormat":"0","filenameRequirementVal":"{作业类型}_{作业名称}_{自然班}_{学号}_{姓名}","fileCount":"1"}]', '循环结构和数组', '<p>实验目的：</p><p>1.掌握循环结构特点，能够正确的使用循环结构，掌握do…while、while、for语句。</p><p>2.正确地设定循环条件，控制循环次数</p><p>3.掌握一维和二维数组的使用，包括定义、初始化、输入输出等。</p><p>4.掌握字符数组、字符串的使用。</p><p>5.掌握与数组有关的算法（例如冒泡排序等）</p><p><br></p><p><br></p><p>1.学习辅导手册p261 (1)题</p><p>2.实验指导书 (第5章5.2节)第5题</p><p>3.学习辅导手册p262 (3)题</p><p>4.实验指导书 (第6章6.2节)第1题</p><p>5.实验指导书 (第6章6.2节)第3题</p>', '2016-10-11 08:08:16', '2016-11-01 15:55:00'),
	('7892E5A078B64A94A67C017C776B8B12', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', 'AB9F64C2B65E4E029FCD90B9F1687B32', '1', '[{"nodeID":0,"parentNodeID":-1,"fileType":"0","fileTypeDescription":"word文件","fileTypeData":"*.doc;*.docx","fileFormat":"0","filenameRequirementVal":"{作业类型}_{作业名称}_{自然班}_{学号}_{姓名}","fileCount":"1"}]', '单词本', '<p>主要功能：</p><p>1.使用Fragment实现英语词典，当竖屏时显示单词释义，当横屏时显示左右两列，右侧是释义，左侧是单词列表。</p><p>2.单词存放在数据库中，系统预先预置一系列单词，用户可以对单词库进行增加、删除、修改等。</p><p>3.支持查询，包括模糊查询等。</p><p>4.作为ContentProvider，供其它应用程序访问（可以编写一个测试程序验证之）。</p><p>5.用户添加单词或者查询单词时，单词含义和示例等信息可以从网络上获得（推荐有道等）。</p><p>6.如有可能，可以网络上获取英语新闻，用户可以针对不认识的单词进行查询和添加到单词库（例如在单词上长按，弹出上下文菜单供用户操作）等。</p><div><br></div>', '2016-09-05 06:21:45', '2016-10-31 13:55:00'),
	('796F389ECB6048C18C734C282F27EBFB', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]在Android Studio中创建Hello World程序', '<p><span style="line-height: 1.42857;">在Android Studio中创建Hello World程序，并在模拟器或真实手机上运行。</span><br></p><p>要求：</p><p>1.安装Android Studio，并熟悉其应用</p><p>2.编程实现自己的第一个Android程序（HelloWorld），并将代码上传到github上去。</p><p>3.将实验中遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-08-29 04:34:42', '2016-10-01 15:55:00'),
	('8EDC25766C274DB8A0AB978E19DA09C5', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践，选做]使用RecyclerView显示数据。', '<p>1.学会使用RecyclerView组件显示大量数据。</p><p>2.上网或查看书籍，比较RecyclerView和ListView的不同。</p><p>3.使用瀑布流式风格显示数据。数据请自行定义。</p><p>4.将代码上传到github上。</p><p>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-08-29 05:08:44', '2016-10-01 15:55:00'),
	('90ED81AA73F54F85A8FB7BF15030C844', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践，选做]拍照', '<p>1.熟悉Android里面拍照相关方法。</p><p>2.编程实现拍照、把照片保存为文件等。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-05 06:03:54', '2016-10-01 13:55:00'),
	('952C17AD45AC4DA3BD50A56A3E384769', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]使用Handler处理消息', '<p>使用Handler在新线程中发送消息，然后在主线程中处理消息</p><p>1.了解ANR，理解线程编程。</p><p>2.学会使用Handler处理消息。</p><p>3.编程实现在新线程中发送消息，然后在主线程中处理消息。</p><p>4.将代码上传到github上。</p><p>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-05 02:27:13', '2016-10-01 13:55:00'),
	('995E92F25AA142DCB430C9F99164BA00', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]学会使用ListView', '<p>使用ListView，参照2.5.3节内容，实现课程系统中用户列表信息，每个item显示用户名字、班级、学号等。</p><p>要求：</p><p>1.每个item信息（用户名字、班级、学号、性别、手机号等）不能少于2个。</p><p>2.数据可以使用数组定义，也可以使用资源文件定义。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-08-29 05:07:36', '2016-10-01 15:55:00'),
	('A6EFB015690B442D9EC2B1F66A031261', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', 'B4BB25408D6849618BB0CE917A69DE5C', '1', '[]', '综合项目', '<p><br></p>', '2016-12-18 14:27:31', '2017-01-02 14:27:00'),
	('A6F1CC05F34947768E776358B7746F00', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]MediaPlayer', '<p>1.熟悉MediaPlayer播放器的用法。</p><p>2.使用MediaPalyer实现音乐播放器，包括播放、暂停、停止等功能。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-05 06:03:36', '2016-10-01 13:55:00'),
	('A7286F7B31D64929B146BE8B2B009304', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]简单图形绘制', '<p>1.熟悉自定义View方法</p><p>2.编程绘制简单图形。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-05 11:16:05', '2016-10-01 13:55:00'),
	('AEC16235F4334B889C5E80D5C2D5DCD8', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '使用ContentObserver', '<p>1.掌握ContentObserver基本概念。</p><p>2.监控联系人发生改变（例如增加联系人）时情况。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-04 02:54:29', '2016-10-01 13:55:00'),
	('B0890B5F12C34D9B9E98038FF994386C', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]学会使用Logcat调试程序', '<p>[上机实践]<span style="line-height: 1.42857;">学会使用Logcat调试程序</span></p><p>要求：</p><p>1.掌握Logcat的使用</p><p>2.学会对Logcat信息过滤，掌握自定义过滤器的使用。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-08-29 04:39:06', '2016-10-01 15:55:00'),
	('B9272ADBC051442285276957C551913A', 'E3BDEF0490D94F8C883A7495607BC8F8', '438FAA7ED7DA41069CC933B99A1C314D', 'B3DAA102CB5C4DB09273761AF45B7132', '1', '[{"nodeID":0,"parentNodeID":"-1","fileType":"0","fileTypeDescription":"word文件","fileTypeData":"*.doc;*.docx","fileFormat":"0","filenameRequirementVal":"{作业类型}_{作业名称}_{自然班}_{学号}_{姓名}","fileCount":"1"}]', '结构体', '<p>结构体<br>实验目的：<br>1.掌握结构体的概念和使用<br>2.掌握结构体数组的概念和使用。<br>3.使用malloc和free等动态申请和释放内存</p><p><br>实验内容：<br>1.实验指导书 (第9章9.2节)第1题<br>2.实验指导书 (第9章9.2节)第2题<br></p>', '2016-12-06 12:55:26', '2016-12-26 12:55:00'),
	('BC71CB6FE42E4E589198D85C69812D2D', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', 'B4BB25408D6849618BB0CE917A69DE5C', '1', '[]', '单词本', '<p><br></p>', '2016-12-18 14:27:20', '2017-01-02 14:27:00'),
	('BE4F87352C50443B8295F68350BA227A', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]进一步熟悉Intent Filter', '<p>注意与前面的上机实践（使用Intent隐式启动）略有不同，熟悉data等元素的使用方法<br>1.熟悉intent filter的含义与作用<br>2.熟悉action，category、data等用法<br>3.理解Android对intent filter的处理与匹配过程<br>4.将代码上传到github上。<br>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。<br></p>', '2016-08-31 02:38:30', '2016-10-01 15:55:00'),
	('C9EC7B32CB0F49439E1D409B2A69F603', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]使用startService启动服务', '<p>1.掌握Service基本特点。</p><p>2.掌握startService启动服务方法。</p><p>3.编程实现使用startService启动服务并传递值，并且通过logcat输出该值。</p><p>4.将代码上传到github上。</p><p>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-04 08:12:33', '2016-10-01 13:55:00'),
	('D065926239414B4E9CE3318282B00D84', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]外部存储文件操作', '<p>1.理解SD卡等外部存储器</p><p>2.理解权限概念，并能够在AndroidManifest.xml中配置权限。</p><p>3.掌握模拟器设置SD卡等方法。</p><p>4.编程实现向SD卡写入学号、姓名等信息并读取、显示这些信息。</p><p>5.将代码上传到github上。</p><p>6.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-01 06:06:21', '2016-10-01 13:55:00'),
	('D10ABC7A3C6C44E3BC4819C8B7A9838A', 'E3BDEF0490D94F8C883A7495607BC8F8', '438FAA7ED7DA41069CC933B99A1C314D', 'B3DAA102CB5C4DB09273761AF45B7132', '1', '[{"nodeID":0,"parentNodeID":"-1","fileType":"0","fileTypeDescription":"word文件","fileTypeData":"*.doc;*.docx","fileFormat":"0","filenameRequirementVal":"{作业类型}_{作业名称}_{自然班}_{学号}_{姓名}","fileCount":"1"}]', '函数', '<p>&nbsp;&nbsp;&nbsp;&nbsp;实验目的：<br>1.掌握函数的原型声明、定义。<br>2.掌握函数调用，包括嵌套调用、递归调用等。<br>3.掌握调用函数时参数传递方式。</p><p>实验内容：<br>1.学习辅导手册p262 (1)题<br>2.学习辅导手册p263 (3)题<br>3.学习辅导手册p263 (4)题<br>4.实验指导书 (第7章7.2节)第2题<br>5.实验指导书 (第7章7.2节)第3题<br>6.学习辅导手册p264 (1)题<br>7.学习辅导手册p264 (3)题<br>8.实验指导书 (第7章7.2节)第4题<br></p>', '2016-10-31 05:16:25', '2016-11-15 15:55:00'),
	('D5F2DFC4A1CE4C21A921CAF71BC0B7E8', 'E3BDEF0490D94F8C883A7495607BC8F8', '438FAA7ED7DA41069CC933B99A1C314D', 'B3DAA102CB5C4DB09273761AF45B7132', '1', '[{"nodeID":0,"parentNodeID":"-1","fileType":"0","fileTypeDescription":"word文件","fileTypeData":"*.doc;*.docx","fileFormat":"0","filenameRequirementVal":"{作业类型}_{作业名称}_{自然班}_{学号}_{姓名}","fileCount":"1"}]', '指针', '<p>指针<br>实验目的：<br>1.掌握指针的概念，地址即指针，指针即地址。<br>2.掌握指针变量的概念，并会定义和使用指针变量。<br>3.学会指针变量作为函数参数的使用方法。<br>4.正确使用数组的指针和指向数组的指针变量。<br>5.正确使用字符串的指针和指向字符串的指针变量。</p><p>实验内容：<br>1.实验指导书 (第8章8.2节)第1题<br>2.实验指导书 (第8章8.2节)第2题<br>4.实验指导书 (第8章8.2节)第4题<br>5.学习辅导手册p266 (1)题<br>5.学习辅导手册p266 (3)题<br>6.学习辅导手册p266 (4)题</p><p><br></p><p>要求：<br>1.课前预习，把题目的主要流程或思路写在纸上，严禁未有任何准备上机。上机前我会检查每个人是否做了准备工作，即是否有流程图或伪代码等，没有扣分。<br>2.课上认真调试程序。由于时间紧张，要求最好课前编写出程序，课上主要调试。<br>3.课后撰写并提交实验报告，实验报告具体格式见课程平台（www.mathtop.com.cn/homework）。<br><br></p><p><br></p>', '2016-11-21 08:49:05', '2016-12-12 15:55:00'),
	('DBD94CD8EB96422BA702F18DAAB79FEC', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]使用bindService启动服务', '<p>1.掌握bindService启动服务方法。</p><p>2.编程实现使用bindService启动服务，并调用Service的各个方法（例如加法等）。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p><div><br></div>', '2016-09-04 08:13:08', '2016-10-01 13:55:00'),
	('EF3C0758C2B14168897D77C0C5033C35', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]生成并调用第二个Activity', '<p>掌握在应用程序中生成多个Activity，学会在Activity之间跳转。<br>要求：<br>1.掌握添加Activity方法<br>2.理解AndroidManifest.XML关于Activity的基本配置<br>3.掌握使用Intent在两个Activity之间跳转。<br>4.将代码上传到github上。<br>5.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。<br></p>', '2016-08-30 01:51:46', '2016-10-01 15:55:00'),
	('F7E45151EB7144A29B2F588B55518D1D', 'A4E1255B4B124854A7ABAAF0C612ED90', '438FAA7ED7DA41069CC933B99A1C314D', '46DF080EAB4A441EB3DDA4F6CC9FF4C0', '1', '[]', '[上机实践]广播', '<p>1.理解广播概念，广播的发送与接收相关知识。</p><p>2.编程实现广播的发送与接收。</p><p>3.将代码上传到github上。</p><p>4.将遇到的问题、分析与理解、知识点小结等上传到gitbook上去。</p>', '2016-09-05 02:27:35', '2016-10-01 13:55:00');
